import { Avatar } from '@material-ui/core';
import React from 'react'
import './Message.css';

function Message() {
    return (
        <div className="message">
            <Avatar></Avatar>
            <div className="message__info">
                <h4>wangdav_id
                    <span>This is a timestamp</span>
                </h4>
            </div>
        </div>
    )
}

export default Message;
